import React from "react";
import { Link } from "react-router-dom";

//add
// West Grove Common
//Mary Park Hall
// Mary Ward Hall
// Towers Junior Suites
// Towers at Centennial Square
// Village at Centennial Square
// University Park South

const LandingPage = () => {
  return (
    <div>
      <Link to={`/manzanita-square`}>Manzanita Square</Link>
      <br />
      <Link to={`/university-park-north`}>University Park North</Link>
      <br />
      <Link to={`/towers-at-centennial-square`}>Towers</Link>
      <br />
      <Link to={`/towers-at-junior-suites`}>Towers</Link>
      <br />
      <Link to={`/west-grove-common`}>Towers</Link>
      <br />
      <Link to={`/towers`}>Towers</Link>
      <br />
      <Link to={`/towers`}>Towers</Link>
      <br />
